"   <div class=\"block mop drugH1Div\" id=\"F212286\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Blood pressure, heart rate; body weight changes; CNS depression, fall risk, skin changes, behavior changes (eg, compulsive behaviors)",
"    </p>",
"   </div>",
"   <div class=\"list fbnlist drugH1Div drugBrandNames\" id=\"F212300\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     International Brand Names",
"    </span>",
"    <ul>",
"     <li>",
"      Mirapex (AR, BR, CN, KP, TW, VE);",
"     </li>",
"     <li>",
"      Mirapexin (AT, BE, BG, CH, CZ, DE, DK, FI, FR, GB, GR, HN, IE, IT, NL, NO, PL, PT, RU, SE, TR);",
"     </li>",
"     <li>",
"      Pexola (CO, UY);",
"     </li>",
"     <li>",
"      Sifrol (AE, AR, AT, BE, BG, BH, BR, CH, CL, CN, CY, CZ, DE, DK, EG, FI, FR, GB, GR, HN, ID, IE, IL, IQ, IR, IT, JO, KW, LB, LY, MX, MY, NL, NO, OM, PE, PH, PT, PY, QA, RU, SA, SE, SG, SY, TR, VE, YE)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F212278\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Pramipexole is a nonergot dopamine agonist with specificity for the D",
"     <sub>",
"      2",
"     </sub>",
"     subfamily dopamine receptor, and has also been shown to bind to D",
"     <sub>",
"      3",
"     </sub>",
"     and D",
"     <sub>",
"      4",
"     </sub>",
"     receptors. By binding to these receptors, it is thought that pramipexole can stimulate dopamine activity on the nerves of the striatum and substantia nigra.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F212293\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: Rapid",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: V",
"     <sub>",
"      d",
"     </sub>",
"     : 500 L",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: ~15%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Negligible (&lt;10%)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Bioavailability: Immediate release: &gt;90%; Extended release (as compared to immediate release): 100%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: 8.5 hours; Elderly: 12 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak, serum: Immediate release: ~2 hours; Extended release: 6 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (90% as unchanged drug)",
"    </p>",
"   </div>",
"  </div>",
