var title_f31_19_32061="Chemo regimens relapsed or refractory AML";
var content_f31_19_32061=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F82823&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F82823&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Chemotherapy regimens for relapsed or refractory acute myeloid leukemia (AML) in adults",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Regimen",
"       </td>",
"       <td class=\"subtitle1\">",
"        Common side effects",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comments",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cytarabine plus daunorubicin",
"       </td>",
"       <td>",
"        Common nonhematologic side effects seen in the majority of patients include stomatitis (mostly mild), alopecia, nausea and vomiting (10 percent severe), and diarrhea (mostly mild). Daunorubicin can be associated with an infusion reaction and cardiac arrhythmias; a flu-like syndrome and rash due to cytarabine may be seen during induction.",
"       </td>",
"       <td>",
"        Re-induction with cytarabine plus daunorubicin will produce a complete remission in approximately 50 percent of patients with a first remission",
"        <strong>",
"         lasting longer than",
"        </strong>",
"        one year",
"        <sup>",
"         [1]",
"        </sup>",
"        .",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        High-dose cytarabine (HiDAC)",
"       </td>",
"       <td>",
"        The most common nonhematologic toxicities are nausea and vomiting, abnormal liver chemistries, diarrhea, conjunctivitis, rash, and cerebellar dysfunction. Toxicity is high in most patients over the age of 60 years.",
"       </td>",
"       <td>",
"        HiDAC may be effective in 35 to 40 percent of patients resistant to conventional dose cytarabine regimens",
"        <sup>",
"         [2]",
"        </sup>",
"        .",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        High-dose cytarabine plus mitoxantrone (HAM)",
"       </td>",
"       <td>",
"        In addition to the side effects described for HiDAC above, nonhematologic toxicities include stomatitis, infections, and neutropenic fever. Infrequent transient, mild cardiac failure and tachyarrhythmias have also been reported.",
"       </td>",
"       <td>",
"        If an anthracycline (eg, daunorubicin) was not used during initial induction, the combination of HiDAC plus the synthetic anthracycline analogue, mitoxantrone, may produce higher response rates than HiDAC alone",
"        <sup>",
"         [3]",
"        </sup>",
"        .",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        High-dose cytarabine plus etoposide",
"       </td>",
"       <td>",
"        In addition to the side effects described for HiDAC above, nonhematologic toxicities include hepatic toxicity, peripheral neuropathy, and anaphylactic-like reaction.",
"       </td>",
"       <td>",
"        HiDAC plus etoposide results in similar response rates as HiDAC alone with a nonsignificant trend towards longer remission duration",
"        <sup>",
"         [4]",
"        </sup>",
"        .",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Mitoxantrone plus etoposide",
"       </td>",
"       <td>",
"        Nonhematologic toxicities include stomatitis, nausea, infections, and neutropenic fever. Infrequent transient, mild cardiac failure and tachyarrhythmias have also been reported.",
"       </td>",
"       <td>",
"        Mitoxantrone and etoposide given together for five days is a commonly used regimen to treat refractory or relapsed AML and has demonstrated complete response rates of approximately 40 percent",
"        <sup>",
"         [5]",
"        </sup>",
"        .",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Mitoxantrone, etoposide, cytarabine (MEC)",
"       </td>",
"       <td>",
"        Side effects are similar to those described for mitoxantrone plus etoposide above, but also include hepatic dysfunction.",
"       </td>",
"       <td>",
"        MEC demonstrates a trend towards higher complete response rates for patients &lt;60 years old and those with unfavorable risk cytogenetics when compared with mitoxantrone plus etoposide alone",
"        <sup>",
"         [6]",
"        </sup>",
"        .",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Fludarabine, cytarabine, plus G-CSF (FLAG)",
"       </td>",
"       <td>",
"        Studies including older adults have reported mild nonhematologic toxicity, most commonly with mucositis.",
"       </td>",
"       <td>",
"        FLAG has reported complete remission rates of 45 to 55 percent in patients with primary refractory or relapsing AML",
"        <sup>",
"         [7]",
"        </sup>",
"        .",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Cladribine, cytarabine, G-CSF (CLAG)",
"       </td>",
"       <td>",
"        Nonhematologic toxicity is generally mild to moderate (grade I/II) and includes fever/infection, mucositis, nausea and vomiting, diarrhea, and alopecia.",
"       </td>",
"       <td>",
"        CLAG results in a complete remission in approximately 50 percent of patients, with a median duration of response of 16 weeks",
"        <sup>",
"         [8]",
"        </sup>",
"        .",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Cyclophosphamide plus high-dose etoposide",
"       </td>",
"       <td>",
"        The most common non-hematologic toxicities include fever/infection, mucositis, hepatic toxicity, and hemorrhagic cystitis.",
"       </td>",
"       <td>",
"        Approximately 42 percent of patients with resistant AML will achieve a complete remission",
"        <sup>",
"         [9]",
"        </sup>",
"        .",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Patients with resistant or relapsed AML should be encouraged to enroll on a clinical trial. While a number of chemotherapy regimens have been used for patients with resistant or relapsed disease, none results in acceptable long term remission rates. Many of these combinations are dose-intensive and cannot easily be applied in older patients. Since these regimens have not been directly compared, a choice is primarily based upon clinical experience and patient co-morbidities. A selection of these regimens is described above. Although response rates are presented for some of these regimens, an individual's chance of responding to a particular regimen is influenced not only by prior exposure to chemotherapy but also by other patient- and leukemia-associated factors. In theory, the preferred regimen to treat relapsed AML would exclude agents at dose levels which the patient has been exposed to recently.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br>",
"      <ol>",
"       <li>",
"        J Clin Oncol 2005; 23:1969.",
"       </li>",
"       <li>",
"        J Clin Oncol 1985; 3:992.",
"       </li>",
"       <li>",
"        Leuk Res 1999; 23:787.",
"       </li>",
"       <li>",
"        Leukemia 1994; 8:1847.",
"       </li>",
"       <li>",
"        J Clin Oncol 1988; 6:213.",
"       </li>",
"       <li>",
"        Leuk Res 2012; 36:394.",
"       </li>",
"       <li>",
"        Br J Haematol 2001; 112:127.",
"       </li>",
"       <li>",
"        Leuk Lymphoma 2000; 39:121.",
"       </li>",
"       <li>",
"        Blood 1990; 76:473.",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
